import React from 'react';
import '../styles/ProductList.css';
import Blazer1 from './Images/Blazer_1.jpg';
import Sherwani1 from '../assets/Images/Sherwani_1.jpg';
import Blazer2 from '../assets/Images/Blazer_2.jpg';
import Sherwani2 from '../assets/Images/Sherwani_2.jpg';

const products = [
  {
    id: 1,
    name: 'Blazer',
    price: '$150',
    image: Blazer1,
  },
  {
    id: 2,
    name: 'Sherwani',
    price: '$200',
    image: Sherwani1,
  },
  {
    id: 3,
    name: 'Blazer',
    price: '$160',
    image: Blazer2,
  },
  {
    id: 4,
    name: 'Sherwani',
    price: '$210',
    image: Sherwani2,
  },
];

const ProductList = () => {
  return (
    <div className="product-list">
      {products.map(product => (
        <div key={product.id} className="product">
          <img src={product.image} alt={product.name} className="product-image" />
          <h2>{product.name}</h2>
          <p>{product.price}</p>
          <button>Add to Cart</button>
        </div>
      ))}
    </div>
  );
};

export default ProductList;
